package com.addapta.calendar.getway.dto;

public class DtoNuevaCita {

	private String id;
	private boolean ok;
	private boolean ko;
	
	public DtoNuevaCita() {
		super();
		// TODO Auto-generated constructor stub
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public boolean isOk() {
		return ok;
	}

	public void setOk(boolean ok) {
		this.ok = ok;
	}

	public boolean isKo() {
		return ko;
	}

	public void setKo(boolean ko) {
		this.ko = ko;
	}
	
	
	
	
}
